class SevenWonders:
    def __init__(self, input_str: str) -> None:
        self.cards = input_str

    def calculate_points(self) -> int:
        tablets = 0
        compasses = 0
        gears = 0
        total_points = 0

        for card in self.cards:
            if card == 'T':
                tablets += 1
            elif card == 'C':
                compasses += 1
            elif card == 'G':
                gears += 1

        total_points += tablets**2
        total_points += compasses**2
        total_points += gears**2

        if tablets >= 3 and compasses >= 3 and gears >= 3:
            total_points += 7

        return total_points

